import axios from "axios";
import { url } from './../constants/auth'

export const Login = async (username, password) => {
    try {
        console.log(111);
        const data = await axios.post(url + "/auth/login", {
            username,
            password
        });
        console.log('login', data);
        if (!data.data.error) {
            return true;
        } else {
            return false;
        }
    } catch (error) {
        if (error) {
            return false;
        }
    }
}
